import { useState } from "react";
import "./css/otp.css";

const Otp = () => {
    const [otpDetails,setotpDetails] = useState(
        {
            email : "",
            otp : ""
        }
    )
    return (
        <>
            <div className="container1">
                Enter the code generated on your email below to be active user !



                <form className="digit-group" data-group-name="digits" data-autosubmit="true" autocomplete="on">

                    <div className="box">
                        <label for="email" className="fl fontLabel"> Email ID: </label>
                        <div className="fl iconBox"><i className="fa fa-envelope" aria-hidden="true"></i></div>
                        <div className="fr">

                            <input type="email" required value={details.email} name="email" placeholder="Email Id" onChange={inputChange} className="textBox" />
                        </div>
                    </div>
                    <input type="text" id="digit-1" name="digit-1" data-next="digit-2" />
                    <input type="text" id="digit-2" name="digit-2" data-next="digit-3" data-previous="digit-1" />
                    <input type="text" id="digit-3" name="digit-3" data-next="digit-4" data-previous="digit-2" />
                    <input type="text" id="digit-3" name="digit-3" data-next="digit-4" data-previous="digit-2" />
                </form>
            </div>
        </>
    )
}

export default Otp;
